inline Matrix qpow(Matrix *a, size_t b)
{
    Matrix result('I');
    if (b & 1)
    {
        result = result * (*a);
    }
    b >>= 1;
    while (b)
    {
        a = new Matrix(*a * *a);
        if (b & 1)
        {
            result = result * (*a);
        }
        b >>= 1;
    }
    return result;
}
double qpow(double a, size_t b)
{
    double result = 1.0;
    while (b)
    {
        if (b & 1)
        {
            result *= a;
        }
        b >>= 1;
        a *= a;
    }
    return result;
}
